import React from 'react';
import DiffViewer from 'react-diff-view';

const oldValue = `
function MyComponent() {
  return <div>Hello, new world!</div>;
}
`;
const newValue = `
function MyComponent() {
  return <div>Hello, old world!</div>;
}
`;

const MyApp = () => (
  <DiffViewer
    oldValue={oldValue}
    newValue={newValue}
    splitView={true}
  />
);

export default MyApp;
